import React, { Component } from 'react';
import { BrokerName } from './Header.styled.js';

class HeaderSection extends Component {
  constructor(props){
    super(props);
    this.state={};
  }

  render() {
    return (
      <div>
        <BrokerName>{this.props.data.broker.name}</BrokerName>
      </div>
    );
  }
}

export default HeaderSection;
